import React, {Component } from 'react';
import './section4.css';
import {Row,Col} from  "react-bootstrap";


class SecFour extends Component {
    render() { 
        return ( 
            <div className="section4-container">
            <center>
                <p className="psec4">Improve the lives of millions. Change yours forever</p>
                <p className="p1sec4">More than 500 team mates share our same vision, goals and passion.<br></
                br> With offices in Warsaw, Barcelona, Istanbul, Rome, Czech Republic,<br></br>
                 Mexico City, Colombia and Curitiba, our search for great talent never stops.</p>




            </center>
           
           
                    
            </div>
         );
    }
  }
  
  
  
    export default SecFour;
